from collections import Counter
"""
Given two strings s and t which consist of only lowercase letters.

String t is generated by random shuffling string s and then add one more letter at a random position.

Find the letter that was added in t.

Example:
    Input:
        s = "abcd"
        t = "abcde"
    Output:
        e
    Explanation:
        'e' is the letter that was added.
"""


def findTheDifference(s: str, t: str) -> str:
    # 40 ms, faster than 83.95%.
    a, b = map(Counter, (s, t))
    return list((b-a).elements())[0]


def findTheDifference2(s: str, t: str) -> str:
    # 36 ms, faster than 98.97%.
    ss, st = set(s), set(t)
    diff = st.difference(ss)
    if diff:
        return diff.pop()
    else:
        for c in ss:
            if s.count(c) != t.count(c):
                return c


def findTheDifference3(s: str, t: str) -> str:
    # 40 ms, faster than 83.95%. The best solution from submissions (32 ms).
    ans = 0
    for ss in s:
        ans ^= ord(ss)  # *** ^ operation between integers. 7^7 = 0. 7^7^6 = 6

    for tt in t:
        ans ^= ord(tt)
    return chr(ans)


print(findTheDifference("abcd", "abcde"))
print(findTheDifference("",
""))

